import React from 'react';
import { BrowserRouter as Router, Switch, Route, Link } from 'react-router-dom';

import CreateEditResume from './CreateEditResume';
import ViewResume from './ViewResume';

const App = () => {
  return (
    <Router>
      <div className="container mt-5">
        <h1>Resume Builder</h1>

        <ul className="nav">
          <li className="nav-item">
            <Link to="/create-edit-resume" className="nav-link">Create/Edit Resume</Link>
          </li>
          <li className="nav-item">
            <Link to="/view-resume" className="nav-link">View Resume</Link>
          </li>
        </ul>

        <Switch>
          <Route exact path="/create-edit-resume" component={CreateEditResume} />
          <Route exact path="/view-resume" component={ViewResume} />
        </Switch>
      </div>
    </Router>
  );
}

export default App;
